@Njreardo Thanks for the explanation! 

IMO, while the `update_baseline` argument certainly sounds useful for your usecase, it seems like a sufficiently different usecase from what the `EarlyStopping` callback was designed for that you should just create your own callback for this

The `EarlyStopping` callback is only intended to stop training when validation performance stops improving. It's not intended for the usecase of selecting the best model during a grid search. By keeping each callback focused on a particular usecase, we'll avoid confusing users (e.g., users would have to understand what `update_baseline` means in order to use `EarlyStopping`, which is extra cognitive load that most users don't need for this usecase)

