@janjongboom  Thanks for this. The RequestScratchBufferInArena/GetScratchBuffer should not be removed. It should still be used for CMSIS scratch buffer. Whenever Scratch buffer API can be used it should be since it has not the same life time as the interpreter, like AllocatePersistentBuffer and hence memory can be reused. The CMSIS API expects a scratch buffer and then RequestScratchBufferInArena/GetScratchBuffer is perfect.
Until recently it was not possibly to have both AllocatePersistentBuffer and RequestScratchBufferInArena mixed but now it should be possible since this PR is merged: https://github.com/tensorflow/tensorflow/commit/59d177d9acabe8e70bc33e554a364d2620bc6999
So please add back the RequestScratchBufferInArena/GetScratchBuffer. Thanks.

